import { Grid, Typography } from "@material-ui/core";
import axios from "axios";
import { useEffect, useState } from "react";
import ListSSA from "./ListSSA";



const ConvertExcel = () => {
    useEffect(() =>{
        GetAllExcel()
    },[])

    const [allExcel, setAllExcel] = useState({})

    const GetAllExcel =() =>{
            
        axios.post(`http://localhost:5000/api/ConvertAll-Excel`)
            .then(res =>  setAllExcel(res.data))
    }

    return ( 
        <Grid container>
            
            <Grid item>
                <ListSSA pos={allExcel} key={allExcel.index} />

            </Grid>

        </Grid>
     );
}
 
export default ConvertExcel;
